'''
Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).

For example,
S = "ADOBECODEBANC"
T = "ABC"
Minimum window is "BANC".

Note:
If there is no such window in S that covers all characters in T, return the empty string "".

If there are multiple such windows, you are guaranteed that there will always be only one unique minimum window in S.
'''

import copy

class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        if len(s) == 0 or len(t) == 0:
            return ''

        def freq_of_char(string):
            map = {}
            for c in string:
                if c not in map:
                    map[c] = 0
                map[c] += 1
            return map
        freq = freq_of_char(t)

        def next_valid(string, freq):
            nxt = {}
            pre = -1
            for i in range(len(string)):
                if string[i] in freq:
                    nxt[pre] = i
                    pre = i
            nxt[pre] = len(string)
            return nxt
        next = next_valid(s, freq)

        beg = end = next[-1]
        if beg == len(s):
            return ''
        cur_freq = {s[beg]: 1}
        cnt = 1
        if cnt == len(t):
            return s[beg:end+1]
        res = (len(s) + 1, s)
        while beg < len(s) and end < len(s):
            print(beg, end, cnt, len(t), res[0], cur_freq)
            if end - beg + 1 >= res[0]:
                cur_freq[s[beg]] -= 1
                if cur_freq[s[beg]] < freq[s[beg]]:
                    cnt -= 1
                beg = next[beg]
                if beg == len(s):
                    break
                continue
            if cnt == len(t):
                res = res if res[0] <= end-beg+1 else (end-beg+1, s[beg:end+1])
                cur_freq[s[beg]] -= 1
                print('>>>>>>>', cur_freq, freq, s[beg])
                if cur_freq[s[beg]] < freq[s[beg]]:
                    cnt -= 1
                beg = next[beg]
                if beg == len(s):
                    break
                continue
            if cnt < len(t):
                end = next[end]
                if end == len(s):
                    break
                if s[end] not in cur_freq:
                    cur_freq[s[end]] = 0
                cur_freq[s[end]] += 1
                if cur_freq[s[end]] <= freq[s[end]]:
                    cnt += 1
        return res[1] if res[0] < len(s) else ''

